def cds(a, b, x, y):
    return ((x + y) / (2 * a), (x - y) // (2 * b))

def norm(x, y):
    return max(x, y)

def min_bad_cells(a, b, x1, y1, x2, y2):
    (xp1, yp1) = cds(a, b, x1, y1)
    (xp2, yp2) = cds(a, b, x2, y2)
    return norm(abs(xp1 - xp2), abs(yp1 - yp2))

